@Dr.exsack jetzt gibts es halt nicht mehr... komm drber hinweg...
Man man man da haben einige ja noch ganz sch was aufzuarbeiten...
In deutschland weinen wir doch auch nicht der weimarer republik hinterher

@82Buhmann Dein Vergleich hinkt aus mehreren Grnden. Erstens bezieht sich mein Kommentar auf historische Fakten und die Etymologie des Namens "Palstina", whrend du mit einem abwertenden und provokanten Vergleich von Schweinestllen operierst, der inhaltlich keine Relevanz hat. Die Geschichte der Region und die Entstehung des Namens ist ein komplexes Thema, das nicht durch platte Analogien erklrt werden kann.

Zweitens geht es in der Geschichtsschreibung nicht darum, wem etwas gehrt, sondern um historische Bezeichnungen und kulturelle Entwicklungen, die sich ber Jahrhunderte und durch zahlreiche Vlker hinweg ergeben haben. Deine Aussage simplifiziert das Thema stark, whrend ich versuche, den historischen Kontext zu erlutern.

Vielleicht sollten wir uns auf Fakten konzentrieren, statt auf unsachgeme Vergleiche.

@GoldenAgit vielleicht solltest du mal in der realitt ankommen und dir bewusst sein dass so gut wie kein palstinenser oder israeli sich (auer die bildungselite) sich mit dem geistigen erguss den du gerade von dir gegeben hast auskennt.
Schlussendlich rufen in dieser region schon seit tausenden jahren da unten viele vollidioten: "mein heiliges land" "nein mein heiliges land"...
Christen waren zu den kreuzzgen genauso dumm aber haben sich scheinbar etwas weiterentwickelt

@82Buhmann Es mag sein, dass dich die Herkunft des Namens nicht interessiert, aber in einer Debatte ber historische Legitimitt und die Ansprche auf eine Region spielt die Geschichte und deren Kontext eine zentrale Rolle. Begriffe und Namen sind nicht einfach nur Wrter  sie reprsentieren historische Entwicklungen, Identitten und Rechte, die nicht ignoriert werden knnen.

Die Ignoranz gegenber solchen Fakten mag bequem erscheinen, bringt uns aber in der Diskussion nicht weiter. Wenn wir die Komplexitt der Geschichte auen vor lassen, landen wir bei oberflchlichen Behauptungen, die wenig zur tatschlichen Aufklrung beitragen.

Es geht nicht nur darum, wen etwas berzeugt, sondern um eine fundierte, sachliche Auseinandersetzung mit dem Thema. Wenn dir das zu viel ist, solltest du vielleicht berlegen, ob du in dieser Debatte die richtige Grundlage hast, um mitzureden.
